import { Component } from '@angular/core';

@Component({
  selector: 'app-alta',
  templateUrl: './alta.component.html',
  styleUrls: ['./alta.component.css']
})
export class AltaActorComponent 
{
    actor : Actor;
    constructor()
    {
      this.actor = new Actor();
    }
}

export class Actor 
{
  nombre : string;
  apellido : string;
  dirección : string;
  usuario : string;
  pais : string;
  email : string;
  estado : string;
  zip : number;

  constructor(nombre : string = "", apellido : string = "", dirección : string = "", usuario : string = "", pais : string = "", 
    email : string = "", estado : string = "", zip : number = 0)
  {
    this.nombre = nombre;
    this.apellido = apellido;
    this.dirección = dirección;
    this.usuario = usuario;
    this.pais = pais;
    this.email = email;
    this.estado = estado;
    this.zip = zip;
  }

}
